    else{
        totalday=MonthlyTotalDay[today.getMonth()]
        console.log(`totalday:${totalday},remain:${totalday-today.getDate()+1}`)
    }


    Expenditure = mod.getMonthlyMoney(ID,'Account','cost',mod.StringtoInt(today.getMonth())+1,0);
